import axios from "axios";

const axios_instance = axios.create({
    baseURL: " https://qejewxi9j2.execute-api.us-east-1.amazonaws.com/dev"
});


export const getFiles = () => {
    axios_instance.get("/CreateFolder").then(res => {
        console.log(res);
    }).catch(e => {
        console.log(e);
    });
}
